import React from 'react';
import Serviceccard from './Serviceccard';

const Service = () => {
  return (
    <>
      <div className='container'>
        <h1 className='text-center mt-5'>Our Service</h1>
        <Serviceccard />
      </div>
    </>
  )
}

export default Service;
